import { API_REQUEST } from 'redux-middleware-fetch';

export const getProductDate_DATA = 'Product/getProduct_DATA';

export function getProductDate(data) {
    return dispatch => dispatch({
      [API_REQUEST]: {
        types: [
            getProductDate_DATA,
        ],
        //文件改成json格式
        json: true, 
        //身份驗證用 
        auth: true, 
        method: 'POST',
        //無傳值可不寫
        //body: data,
        entrypoint: '/api/product',
        onSuccess: ({
        }),
      },
    });
  }
